    getContratos() {
        return this.http.get(this.apiURL);
    }
    // Metodo para traer un contrato
    getContrato(contratoId) {
        return this.http.get(this.apiURL + '/' + contratoId);
    }
    // Metodo para crear un nuevo contrato
    createContrato(contrato) {
        return this.http.post(this.apiURL, contrato);
    }
    // Metodo para modificar un contrato
    updateContrato(contrato) {
        return this.http.put(this.apiURL + '/' + contrato.ID, contrato);
    }
    // Metodo para borrar un contrato
    deleteContrato(contratoId) {
        return this.http.delete(this.apiURL + '/' + contratoId);
    }
    // Metodo para setear el id del contrato activo
    setContratoId(contratoId) {
        this.contratoId = contratoId;
    }
    setContratoIncompletoId(id) {
        this.contratoIncompletoId = id;
    }
    getContratoIncompletoId() {
        return this.contratoIncompletoId;
    }
    getIdContratoActivo() {
        if (this.contratoId != "") {
            return this.contratoId;
        }
        else {
            return;
        }
    }
